import React from 'react'
import Dot from "./Dot"

export default function Grid() {
    var grid = [];
    let i, j;
    (function makeGrid(){
        for(i = 0; i <5; ++i){
            for(j = 0; j < 5; ++j)
                grid.push(<Dot key ={((i+1)*5)+j}/>);
            grid.push(<br/>);
        }
    })()
    return (
        <div>{grid}</div>
    )
}
